INSERT INTO `berita` VALUES (687,55,'pkbi','HIV/AIDS','HIV/AIDS','','hivaids','','','','<p><img alt=\"\" src=\"/asset/kcfinder/upload/files/images.jpg\" style=\"height:225px; width:225px\" /></p>\r\n\r\n<p><strong>HIV (<em>human immunodeficiency virus</em>) adalah virus yang merusak sistem kekebalan tubuh dengan menginfeksi dan menghancurkan sel CD4. Jika makin banyak sel CD4 yang hancur, daya tahan tubuh akan makin melemah sehingga rentan diserang berbagai penyakit.</strong></p>\r\n\r\n<p>HIV yang tidak segera ditangani akan berkembang menjadi kondisi serius yang disebut AIDS (<em>acquired immunodeficiency syndrome</em>). AIDS adalah stadium akhir dari infeksi HIV. Pada tahap ini, kemampuan tubuh untuk melawan infeksi sudah hilang sepenuhnya.</p>\r\n\r\n<p><a href=\"https://www.alodokter.com/hidup-bermasyarakat-sebagai-ODHIV\" target=\"_blank\">Penularan HIV</a>&nbsp;terjadi melalui kontak dengan cairan tubuh penderita, seperti darah, sperma, cairan vagina, cairan anus, serta ASI. Perlu diketahui, HIV tidak menular melalui udara, air, keringat, air mata, air liur, gigitan nyamuk, atau sentuhan fisik.</p>\r\n\r\n<p>HIV adalah penyakit seumur hidup. Dengan kata lain, virus HIV akan menetap di dalam tubuh penderita seumur hidupnya. Meski belum ada metode pengobatan untuk mengatasi HIV, tetapi ada obat yang bisa memperlambat perkembangan penyakit ini dan dapat meningkatkan harapan hidup penderita.</p>\r\n\r\n<p>Sumber:&nbsp;https://www.alodokter.com/hiv-aids</p>\r\n','','Sabtu','2023-02-04','22:11:46','',1,'','Y');
